import React, {Component} from 'react';
//引入组件
import './position.scss';
//引入样式

import '../../publicstyle/publicstyle.css';
import Axios from "axios";

//引入样式
import 'antd/dist/antd.css'//蚂蚁设计中样式
class Position extends Component {
    state={
        city:[]
    }
    componentDidMount(){
        //问题1：这个请求的路由现在我是从老师那里拿的现成的，假如老师没有提供，我去哪里找？前提是我需要用易源的接口：
        //从文档事例中获取
        Axios.get("http://route.showapi.com/9-5", {
            params: {
                //注：showapi_appid这个前缀必须要
                'showapi_appid': '79641',
                'showapi_sign':"7636d5eea9134d3dba00ee63b7e33f3a",
            }
        }).then((res)=>{
            console.log(res)
        })
    }
    render() {
        return (
            <div className="header">
                {/*头部*/}

                    {/*1、定位区块*/}
                    <div className="location">
                        {/*<span></span>*/}
                        <span className="location-icon iconfont icon-dingwei"></span>
                        <span className="location-text">成都市双流区</span>
                        <span className="location-choose iconfont icon-plus-select-down"></span>
                    </div>

            </div>
        );
    }
}

export default Position;
